description:
This art is part of a project I created to represent each fan of each team in Rio, my idea was to represent a little each energy of each team, this is my representation of the fans of Fluminense.

///////////////////////////////////////////////////////////////

Essa arte faz parte de um projeto no qual eu criei para representar cada torcedor de cada time do Rio, minha ideia foi representar um pouco cada energia de cada time, essa é minha representação da torcida do Fluminense.
